import React, { useState } from 'react';
import { PlusIcon, TrashIcon } from '@heroicons/react/24/outline';

const initialDeadlines = [
  { id: 1, name: 'Annual Report Filing', dueDate: '2025-03-31' },
  { id: 2, name: 'Q1 VAT Return', dueDate: '2025-04-30' },
  { id: 3, name: 'GDPR Compliance Review', dueDate: '2025-05-25' },
];

const ComplianceDeadlines = () => {
  const [deadlines, setDeadlines] = useState(initialDeadlines);
  const [showAddForm, setShowAddForm] = useState(false);
  const [newDeadline, setNewDeadline] = useState({ name: '', dueDate: '' });

  const handleAddDeadline = (e) => {
    e.preventDefault();
    if (newDeadline.name && newDeadline.dueDate) {
      setDeadlines([...deadlines, { ...newDeadline, id: Date.now() }]);
      setNewDeadline({ name: '', dueDate: '' });
      setShowAddForm(false);
    }
  };

  const handleDeleteDeadline = (id) => {
    setDeadlines(deadlines.filter(d => d.id !== id));
  };

  return (
    <div className="space-y-8">
      <div>
        <h3 className="text-xl font-bold text-gray-900">Compliance Deadlines</h3>
        <p className="text-sm text-gray-500 mt-1">Track upcoming legal and regulatory deadlines to stay compliant.</p>
      </div>

      <div className="flex justify-end">
        <button
          onClick={() => setShowAddForm(!showAddForm)}
          className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-blue-600 hover:bg-blue-700"
        >
          <PlusIcon className="h-5 w-5 mr-2" />
          {showAddForm ? 'Cancel' : 'Add New Deadline'}
        </button>
      </div>

      {showAddForm && (
        <div className="bg-white p-6 rounded-lg shadow border border-gray-200">
          <form onSubmit={handleAddDeadline} className="grid grid-cols-1 md:grid-cols-3 gap-6 items-end">
            <div className="md:col-span-1">
              <label className="block text-sm font-medium text-gray-700">Deadline Name</label>
              <input
                type="text"
                value={newDeadline.name}
                onChange={(e) => setNewDeadline({ ...newDeadline, name: e.target.value })}
                className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Due Date</label>
              <input
                type="date"
                value={newDeadline.dueDate}
                onChange={(e) => setNewDeadline({ ...newDeadline, dueDate: e.target.value })}
                className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
                required
              />
            </div>
            <div className="flex justify-end">
              <button type="submit" className="px-4 py-2 bg-blue-600 text-white font-medium rounded-md hover:bg-blue-700">
                Save Deadline
              </button>
            </div>
          </form>
        </div>
      )}

      <div className="bg-white shadow overflow-hidden sm:rounded-md">
        <ul className="divide-y divide-gray-200">
          {deadlines.map(deadline => (
            <li key={deadline.id}>
              <div className="px-4 py-4 sm:px-6 flex items-center justify-between">
                <div>
                  <p className="text-sm font-medium text-blue-600 truncate">{deadline.name}</p>
                  <p className="text-sm text-gray-500">Due: {new Date(deadline.dueDate).toLocaleDateString()}</p>
                </div>
                <button
                  onClick={() => handleDeleteDeadline(deadline.id)}
                  className="text-gray-400 hover:text-red-600 p-2 rounded-full"
                >
                  <TrashIcon className="h-5 w-5" />
                </button>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default ComplianceDeadlines;
